    value: 'Mr. Vuong: Please be advised that the memo entry on Schedule E in the
      amount of $1,494.13 represents the inadvertent payment of a portion of an independent
      expenditure with nonfederal funds.  The party will make a corrective transfer
      to its nonfederal account.  This entry and the regular entry showing a payment
      to the U. S. Post Office correspond to the entry on the 24-hour notice filed
      on 9/4/08.  The independent expenditure was disseminated on 9/3/08 and payment
      for the independent expenditure was made on 9/4/08. Further, please be advised
      that the payment to P2B Strategies disclosed on Schedule E represents a payment
      for an independent expenditure on behalf of Brian Davis for the 2008 Primary
      which was disseminated on two different dates.  $4541.63 of the disbursement
      was a payment for the portion which was disseminated on 9/3/08 and disclosed
      on a 24-hour notice filed on 9/4/08.  The remaining $4541.63 was for the portion
      that was disseminated on 9/8/08 and did not require a notice.  The date listed
      on Schedule E is the date that the party paid for these communications.  RNC
      transfers were not used to pay for exempt activity on Line 21(b).'
